import React from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';
const Navigationbar = () => (
        <Navbar bg="light" expand="lg">
        <Container>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto">
            <Nav.Link href="">My Photographs</Nav.Link>
            <Nav.Link href="">My Life</Nav.Link>
            <NavDropdown title="Social Media" id="basic-nav-dropdown">
                <NavDropdown.Item href="">Instagram</NavDropdown.Item>
                <NavDropdown.Item href="">Facebook</NavDropdown.Item>
                <NavDropdown.Item href="">Linked In</NavDropdown.Item>
            </NavDropdown>
            </Nav>
            </Navbar.Collapse>            
        </Container>

        </Navbar>
   
);

export default Navigationbar;
